CREATE DEFINER=`root`@`localhost` PROCEDURE `create_product_sales`()
BEGIN
    DROP TABLE IF EXISTS product_sales;
    CREATE TABLE product_sales AS
    SELECT
        -- id columns
        o.order_id,
        p.product_id,
        cu.customer_id,
        ca.category_id,
        -- order table
        o.order_status,
        o.required_date,
        o.shipped_date,
        -- order_items table
        oi.list_price,
        oi.quantity,
        oi.discount,
        -- products table
        p.product_name,
        p.model_year,
        -- customers table
        cu.first_name customer_first_name,
        cu.last_name customer_last_name,
        cu.zip_code customer_zip_code,
        -- categories table
        ca.category_name,
        -- brands table
        b.brand_name
    FROM
        orders o
        JOIN order_items oi USING (order_id)
        JOIN products p USING (product_id)
        JOIN customers cu USING (customer_id)
        JOIN categories ca USING (category_id)
        JOIN brands b USING (brand_id)
    ORDER BY o.required_date, cu.last_name;
END ;;
